package elector

import (
	"context"
	"math"
	"testing"

	"github.com/tonkeeper/tongo/tlb"
	"github.com/tonkeeper/tongo/ton"
	"github.com/tonkeeper/tongo/tvm"
)

func TestGetExtendedParticipantList(t *testing.T) {

	code := ""
	data := ""
	config := ""

	electorAccountID := ton.MustParseAccountID("-1:3333333333333333333333333333333333333333333333333333333333333333")
	e, err := tvm.NewEmulatorFromBOCsBase64(code, data, config)
	if err != nil {
		t.Fatalf("NewEmulatorFromBOCsBase64() failed: %v", err)
	}
	participants, err := GetParticipantListExtended(context.Background(), electorAccountID, e)
	if err != nil {
		t.Fatalf("GetParticipantListExtended() failed: %v", err)
	}
	if len(participants.Validators) != 316 {
		t.Fatalf("got: %v, want: 316", len(participants.Validators))
	}
	pubkeys := make(map[tlb.Bits256]struct{})
	for _, validator := range participants.Validators {
		if validator.Stake < math.MaxInt32 {
			t.Fatalf("stake looks too low: %v", validator.Stake)
		}
		if validator.MaxFactor != 196608 {
			t.Fatalf("got: %v, want: 196608", validator.MaxFactor)
		}
		if _, ok := pubkeys[validator.Pubkey]; ok {
			t.Fatalf("two validators have the same pubkey")
		}
		pubkeys[validator.Pubkey] = struct{}{}
	}

}
